query IndexQuery {
  allMarkdownRemark(limit: 10, sort: {fields: [frontmatter___date], order: DESC}, filter: {frontmatter: {published: {eq: true}}}) {
    edges {
      node {
        id
        frontmatter {
          title
          path
          published
          date
          description
          tags
          volume
          homeImage
          timePeriod
        }
      }
    }
  }
}
